import React from 'react';

const TodoClean = () => {

    const handleClick = (e) => {
        e.preventDefault();
        storage.removeItem("my-todo-list");
        alert();
    };


    return (
        <button onClick={handleClick} className="btn-clean">Clean</button>
    );
};

export default TodoClean;
